import React, {FC, useState} from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBriefcase, faChevronDown, faBars, faXmark } from '@fortawesome/free-solid-svg-icons';
import './_Header.scss';
import Button from '../Button/Button';
import MobileHeader from './MobileHeader/MobileHeader';

interface HeaderProps {
  isMobileMenuOpen: boolean;
  setIsMobileMenuOpen: Function;
}

const Header = ({isMobileMenuOpen, setIsMobileMenuOpen}: HeaderProps) => {

  return (
    <div className='header'>
      <div className='logo-wrapper'>
        <FontAwesomeIcon icon={faBriefcase} />
        <span className='logo-wrapper__header'>work-it</span>

        <ul className='navigation-wrapper'>
          <li>
            <Button styling='header-button'>
                Pagrindinis
            </Button>
          </li>
          <li>
            <Button styling='header-button'>
                Įkelti skelbimą
            </Button>
          </li>
          <li>
            <Button styling='header-button'>
                Ieškoti darbo
              <FontAwesomeIcon icon={faChevronDown} />
            </Button>
          </li>
        </ul>
      </div>

      <div className='header-buttons-wrapper'>
        <Button styling='header-button'>
          Prisijungti
        </Button>

        <Button styling='header-button header-button--register'>
          Registruotis
        </Button>

        {isMobileMenuOpen ? 
          <FontAwesomeIcon 
            icon={faXmark} 
            className='header-button--menu'
            onClick={() => setIsMobileMenuOpen(false)}
          /> :
          <FontAwesomeIcon 
            icon={faBars} 
            className='header-button--menu'
            onClick={() => setIsMobileMenuOpen(true)}
          />
        }
      </div>
    </div>
  )
}


export default Header;
